query:
/*+ NoMergeJoin(ci t mi_idx) */ select count(*)
from cast_info AS ci
inner join title AS t
on t.id = ci.movie_id AND ci.person_id = 924664 AND ci.role_id = 1 AND t.kind_id = 7 AND t.production_year > 1905
inner join movie_info_idx AS mi_idx
on t.id = mi_idx.movie_id AND mi_idx.info_type_id = 99;
